import React, { useEffect, useState } from 'react';
import axios from 'axios';
/* eslint-disable */

export default function ShowMenuItem(props) {
    const [posts, setPosts] = useState([]);
    useEffect(() => {
        axios.get('http://localhost:3000/api/menu/item', { params: { menuItem: props.menuItem } })
            .then(res => {
                console.log(res.data);
                setPosts(res.data);
            });

    }, []);
    return (
    <div>{posts.map((m, key) =>
        <form key={key}>
            <input type="radio" name="a"/>{m.size1}<br />
            <input type="radio" name="a" />{m.size2}<br />
            <input type="radio" name="a" />{m.size3}<br />
        </form>)}
    </div>);
}
